        {/* <Questions 
        currrQues={currrQues}
        setcurrQues={setcurrQues}
        question={question}
        optionss={optionss}
        score={score}
        setscore={setscore}
        setquestion={setquestion}
        correct={question[currrQues]?.correct_answer}
        /> */}
        {question ? 
          <>

          </>
          :
          <CircularProgress style={{margin:100}} color='inherit' size={150} thickness={1} />
            }
      </div>
    )
  }

  export default Quiz
